'use client';
const bgImg =
    'data:image/png;base64,';
const borderImg =
    'data:image/png;base64,';
class Couplet extends HTMLElement {
    static attrs = {
        'first-line': '',
        'second-line': '',
        'central-line': ''
    };
    generateCss(reverse) {
        let css = [];
        const common = `
  position: fixed;
  display: grid;
  grid-template-columns: 1fr;
  padding-top: 20px;
  padding-bottom: 20px;
  background: var(--couplet-color, red);
  transform: translateY(-50%);
  top: 50%;`;
        const left = `${common}
  left: var(--offset-out, 10%);`;
        const right = `${common}
  right: var(--offset-out, 10%);`;
        css.push(`
.first-line {${reverse ? right : left}
}
.second-line {${reverse ? left : right}
}
.central-line {
  position: fixed;
  top: var(--offset-top, 10%);
  left:50%;
  padding-left: 20px;
  padding-right: 20px;
  background: var(--couplet-color, red);
  display: flex;
  width: fit-content;
  transform: translateX(-50%);
  flex-direction: ${reverse ? 'row-reverse' : 'row'};
}
.word {
  font-size: var(--couplet-size, 30px);
  line-height: var(--couplet-size, 30px);
  padding: 10px;
  background-image: url(${bgImg});
  background-size: 100% 100%;
  background-repeat: no-repeat;
  background-position: center center;
  font-weight: var(--couplet-weight, bold);
  color: var(--couplet-color, black);
}
.line{
 opacity:.9;
 border: 10px solid transparent;
 border-image: url(${borderImg}) 22 repeat;
 box-shadow: 0 0 5px 1px rgba(60, 60, 60, 0.8);
}
*{
  font-family: var(--font-family, 'Microsoft YaHei');
  pointer-events: none;
  z-index: 9999999999;
}
::slotted(*) {
	pointer-events: all;
}
            `);
        return css.join('\n');
    }
    createDiv(name) {
        const div = document.createElement('div');
        const item = document.createElement('div');
        item.setAttribute('class', 'word');
        div.setAttribute('class', `${name} line`);
        const text = this.getAttribute(name) || Couplet.attrs[name];
        text.split('').forEach((v) => {
            const word = item.cloneNode();
            word.textContent = v;
            div.appendChild(word);
        });
        return div;
    }

    connectedCallback() {
        // https://caniuse.com/mdn-api_cssstylesheet_replacesync
        if (this.shadowRoot || !('replaceSync' in CSSStyleSheet.prototype)) {
            return;
        }
        const firstLine = this.createDiv('first-line');
        const secondLine = this.createDiv('second-line');
        const centralLine = this.createDiv('central-line');
        let sheet = new CSSStyleSheet();
        sheet.replaceSync(this.generateCss(this.hasAttribute('reverse')));

        let shadowRoot = this.attachShadow({ mode: 'open' });
        shadowRoot.adoptedStyleSheets = [sheet];

        shadowRoot.appendChild(firstLine);
        shadowRoot.appendChild(secondLine);
        shadowRoot.appendChild(centralLine);
        shadowRoot.appendChild(document.createElement('slot'));
    }
}
customElements.define('dragon-couplet', Couplet);
